import React from "react";
import "./Home.css";

export default function Home() {
  return (
    <div className="Course">
      <div className="lander">
        <h1>EduRangers</h1>
        <br/>
        <h2>Edurangers is a unique platform with gamification. Level up your character to become stronger and use more abilities! Pass tests of your professors,  improve your skills. You are not students. You are knights! Prepare your swords for the battle of knowledge and good luck!</h2>
      </div>
    </div>
  );
}
